Objects and Scopes 
Grouping like properties and functionality together can make applications easier to write and maintain. Keeping scope small and targeted is part of that process. These are abstract concepts and will require hands-on practice to connect the dots.
We will move the drink list that is hard coded in the HTML and build it out programmatically using JavaScript. 


This section will help guide you through the following steps:





                Create an object






                Iterate over an array and build on the DOM








Create an array of objects  
We will create an array of objects and access object properties.

In Atom, open index.html and find the div tag containing the drink list. Comment out all the drinks listed inside the div, but don't comment the div tag itself. Save your index.html. We no longer see the drink list in Chrome and our web page is broken for the moment.
Highlight all the  elements inside the div with class "drink-menu" and select Edit  Toggle Comments. You can also use the keyboard shortcut ctrl + / on Windows and cmd + / on Macs. Feel free to ask a mentor for help. 

Remember to use Atom to type code statements and Chrome to verify your work when your web page reloads. Don't forget to save my-script.js every time you type a code statement.


In my-script.js, at the top of the file, create a new const variable named cocktailsArray that will hold the array of drinks. 

We want to populate cocktailsArray with the list of available drinks, which is everything with a radio button in front of it. To do so, each element in the array is an object with 2 properties: "id" and "label". We can add an object to the array like this
const cocktailsArray = [{
   'id': 'focusedLady',
   'label': 'Focused Lady'
 }];

 Everything inside the {} is part of the object. The curly braces help group code statements together. We know the difference between objects and functions by the way we declare it. const myObject = {}; is an object and const myFunction = () => {}; is a function because of the parenthesis arrow in the definition.
Objects can contain key-value pairs like this:
{
          "key": "value",
          "anotherKey": "Another Value"
}

You can use single quotes, double quotes, or use no quotes when declaring keys in an object.


Populate the rest of the cocktailsArray with the remaining drinks. Copy and paste the following code snippet to replace cocktailsArray to avoid typing fatigue. 
 const cocktailsArray = [{
         'id': 'focusedLady',
         'label': 'Focused Lady'
     },
     {
         'id': 'strongLady',
         'label': 'Strong Lady'
     },
     {
         'id': 'frontEndPunch',
         'label': 'Front-End Punch'
     },
     {
         'id': 'cachedOut',
         'label': 'Cached Out'
     },
     {
         'id': 'httPapaya',
         'label': 'httPAPAYA://'
     },
     {
         'id': 'nerdyDaiquiri',
         'label': 'Nerdy Daiquiri'
     },
     {
         'id': 'theAvernaCode',
         'label': 'The Averna Code'
     },
     {
         'id': 'focusedTheMostest',
         'label': 'Focused the Mostest'
     },
 ];

Notice a comma replaces the semicolon after the array declaration and we're not using quotes for the cocktailsArray property but are using single quotes for id and label properties inside each object within the array.



Use built in array function to build a DOM  
We want to iterate over array to build the menu. We have to implement the code to build out the same HTML we commented out previously. Last time we used the built in methods to add to the DOM in a structured way. This time we'll build a string to add to the DOM. 

Create a new function called buildCocktailsMenu after the declaration for the cocktails array with a parameter for cocktails. 

Inside the document.addEventListener("DOMContentLoaded", ...) function at the bottom of the file, before the calls to register the event listeners for the order button, call the new method, buildCocktailsMenu and pass in the drinks array.

Back in the buildCocktailsMenu function, iterate over the cocktails and log each element to the console using the following code
cocktails.forEach( (cocktail) => { 
  console.log(cocktail);
});

The entire object in the array is logged out. We can access properties inside objects using the . notation. What if you want to only log the label within each drink? How would you change your log statement to do so?


In the buildCocktailMenu before the forEach, create a variable named cocktailsString. Because we will modify this string, use let to declare the variable. Set the value to an empty string by setting cocktailsString to open and close quotes, ''. This is the string we'll use to build the DOM.

After the forEach, we need to set the innerHTML property of the DOM element with the class radio-group to the cocktailsString. Using the document selectors we learned in the first section, write the code to do so.


Need a little help? Expand this section for guidance. 

After the forEach use document.querySelector('.radio-group').innerHTML = cocktailsString;.



Inside forEach, we'll use string concatenation to build the string and access the properties of cocktail object and set it to the cocktailsString variable. Replace the console.log with the following code
cocktailsString = '' + cocktail.label + '';

Our goal is to build an HTML element structure that looks like what you commented out in the HTML for each drink object in the array. We want to create something that looks like this using the drink's name and id:


      Focused Lady




Save your file and try running in Chrome. Do you see the cocktail menu? Do you only see one item in the list though? 

Let's take a look at the code again. We're setting the value of cocktailsString to the DOM string for each cocktail. This means the value of cocktailsString is getting overridden each time. We need to add to the string instead of replacing it. Hint-- what were some ways we add in JavaScript?


Need a little help? Expand this section for guidance. 

To add to the cocktails string by using cocktailString = cocktailString + ... or use shorthand method cocktailString += ....



Interact with your web app in Chrome. You should see the drink list and be able to place orders again!




You leveled up your JavaScript skills like a boss! Way to go!!



